// Filename: DomainInfoTable.jsx

import React from 'react';

function DomainInfoTable({ data }) {
  if (!data) return null;

  return (
<div className="overflow-x-auto w-full">
  <table className="min-w-full table-auto bg-white text-black text-sm">
    <thead className="bg-gray-100">
      <tr>
        <th className="border px-4 py-2 text-left min-w-[140px] whitespace-nowrap">Registrant Name</th>
        <th className="border px-4 py-2 text-left min-w-[140px] whitespace-nowrap">Tech Contact</th>
        <th className="border px-4 py-2 text-left min-w-[140px] whitespace-nowrap">Admin Contact</th>
        <th className="border px-4 py-2 text-left min-w-[180px] whitespace-nowrap">Contact Email</th>
      </tr>
    </thead>
    <tbody>
      <tr>
        <td className="border px-4 py-2 break-words">{data?.registrant?.name || 'N/A'}</td>
        <td className="border px-4 py-2 break-words">{data?.technicalContact?.name || 'N/A'}</td>
        <td className="border px-4 py-2 break-words">{data?.administrativeContact?.name || 'N/A'}</td>
        <td className="border px-4 py-2 break-words">{data?.contactEmail || 'N/A'}</td>
      </tr>
    </tbody>
  </table>
</div>

  );
}

export default DomainInfoTable;
